using namespace std;

//recursive solution
class Solution1 {
public:
    void rec(vector<int>&v,int n,int k,int score,int curr,int &ans){
        
        if(curr == n-1) {
            ans=max(ans,score);
            return;
        }
        if(curr >= n) return;
        for(int j=1;j<=k;j++){
            rec(v,n,k,score+v[curr+j],curr+j,ans);
        }
    }

    int maxResult(vector<int>& nums, int k) {
        int n=nums.size();
        int ans=0;
        rec(nums,n,k,nums[0],0,ans);
        return ans;
    }
};

//dp solution
class Solution2 {
public:
    int maxResult(vector<int>& nums, int k) {
        int n=nums.size();
        vector<int>arr(n,0);
        arr[0]=nums[0];
        for(int i=1;i<n;i++){
            int temp=INT_MIN;
            for(int j=1;j<=k;j++){
                if(i-j>=0){
                    temp=max(temp,arr[i-j]);
                }
            }
            arr[i]=nums[i]+temp;
        }
        //for(int i=0;i<n;i++) cout<<arr[i]<<" ";
        cout<<endl;
        return arr[n-1];
    }
};
//dp + optimization using priority queue solution
class Solution {
public:
    int maxResult(vector<int>& nums, int k) {
        int n=nums.size();
        vector<int>arr(n,INT_MIN);
        arr[0]=nums[0];
        multiset<int>pq;
        pq.insert(arr[0]);
        for(int i=1;i<n;i++){
            if(pq.size()>=k){
                auto it=pq.find(arr[i-k-1]);
                pq.erase(*it);
            }
            arr[i]=nums[i]+*rbegin(pq);
            pq.insert(arr[i]);
        }
        return arr[n-1];
    }
};

//more optimzed
class Solution4 {
public:
    int maxResult(vector<int>& nums, int k) {
	vector<int> dp(size(nums));
	dp[0] = nums[0];
	deque<int> q{ 0 };
	for(int i = 1; i < size(nums); i++) {
		if(q.front() < i - k) q.pop_front();         // can't reach current index from index stored in q     
		dp[i] = nums[i] + dp[q.front()];             // update max score for current index
		while(!q.empty() && dp[q.back()] <= dp[i])   // pop indices which won't be ever chosen in the future
		    q.pop_back();
		q.push_back(i);                              // insert current index
	}
	return dp.back();
}
};

